import Item from "./Item";

const List  = (props) => {
    console.log(props.orderList)
    return (
      <Fragment>

        {props.orderList.map((order) => {return (
          <Item order={order}></Item>
        )})}
        <button id={props.id} type="submit" onClick={props.onDelete}>Delete</button>
        </Fragment>
    )
}

export default List;
